import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import { useProjectState, useProjectDispatch } from "../contexts/projects";

const DetailPage = () => {
  let { projectId } = useParams();
  const state = useProjectState();
  const dispatch = useProjectDispatch();

  useEffect(() => {
    dispatch({ type: "GET", id: projectId });
  }, []);

  const setProject = () => dispatch({ type: "GET", id: projectId });
